import React from "react";
import DevPresenter from "./DevPresenter";

export default class extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      count: 0
    };
  }
  state = {
    error: null,
    loading: false,
    show: false,
  };

  render() {
    return <DevPresenter />;
  }
}
